import React, { useState } from "react";
import { NavLink } from 'react-router-dom';

const Uyegiris = () => {
  // Define state variables using useState
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  // Handle email input change
  const handleEmailChange = (e) => {
    setEmail(e.target.value);
  };

  // Handle password input change
  const handlePasswordChange = (e) => {
    setPassword(e.target.value);
  };

  // Handle form submission
  const handleSubmit = (e) => {
    e.preventDefault();
    // Implement your logic for form submission
    console.log("Form submitted with email:", email, "and password:", password);
  };

  return (
    <div  style={{ margin: "100px",  }}>
      <h1 style={{ textAlign: "center", fontStyle:"italic" }}>Hoşgeldiniz</h1>
      <form onSubmit={handleSubmit}>
          <div style={{ display: "block", justifyContent: "center",marginTop: "50px",textAlign:"center"  }}>
        <div >
          <input
            type="email"
            placeholder="E-posta"
            value={email}
            onChange={handleEmailChange}
            className="input-action"
          />
        </div>
        <div style={{ marginTop: "20px", marginBottom:"20px"}}>  
          <input
            type="password"
            placeholder="Parola"
            value={password}
            onChange={handlePasswordChange}
            className="input-action"
          />
        </div>
        <div>
      <NavLink  style={{ color: "#893694" , textDecoration:"none", fontStyle:"italic", marginLeft:"270px"}} to='/Uyegiris'>Parolamı Unuttum</NavLink>
      </div>
      <div style={{ position:"relative", left:"130px"}}>
        <button type="submit"  className="button-action">Gönder</button>
        </div>
        </div>


      </form>

      <hr />
      <div>
        Hesabınız yok mu? <a href="#">Kaydol</a>
      </div>
    </div>
  );
};

export default Uyegiris;
